import React from "react";
import "./loading.css";
import { MDBCardBody } from "mdbreact";

function Loading() {
  return (
    <React.Fragment>
      <MDBCardBody>
        <div className="upp">
          <div className="col-md-12 centrar">
            <h3>Loading...</h3>
          </div>
        </div>
      </MDBCardBody>
    </React.Fragment>
  );
}

export default Loading;
